export const styles = {
  fields: {
    display: "flex",
    marginBottom: "24px",
  },

  priceSection: {
    display: "flex",
    flexDirection: "column",
    width: "272px",
    marginRight: "16px",
  },

  dateSection: {
    display: "flex",
    flexDirection: "column",
    width: "192px",
  },

  title: {
    fontSize: "14px",
  },

  inputwrapper: {
    position: "relative",
    display: "flex",
    alignItems: "center",
    padding: "14px 0px 13px 17px",
    flexWrap: "wrap",
    border: "1px solid #e9eef2",
    borderRadius: "4px",
  },

  input: {
    border: "none",
  },

  date: {
    border: "1px solid #e9eef2",
    borderRadius: "4px",
  },

  currency: {
    display: "flex",
  },
};
